import React, { Component } from "react";

class SearchBar extends Component {

  state={
SearchBar:""
  };
  render() {
    const {SearchBar}=this.state;
    return (
      <React.Fragment>
        <br />
        <form className="form-inline mt-2 fontify">
          <label htmlFor="search">
            <i className="fas fa-search ml-1" aria-hidden="true" />
          </label>
          <input
            name="SearchBar"
            id="search"
            className="form-control form-control-sm ml-3 w-75 "
            type="text"
            aria-label="Search"
            onChange={this.OnInputChange}
            value={SearchBar}
          />
        </form>
      </React.Fragment>
    );
  }
  OnInputChange=({currentTarget:ii})=>{

  };
}

export default SearchBar;
